import React from "react";
import { useNavigate } from "react-router-dom";
import Header from "./Header"; // Assuming you have a Header component

import evilEyeBracelet from "../Components/Assets/a1.png";
import TropicalRainbowAnklet from "../Components/Assets/a2.png";
import boldbeads from "../Components/Assets/a3.png";
import OceanAuraAnklets from "../Components/Assets/a4.png";
import multicolour from "../Components/Assets/a5.png";

import "./Anklets.css"; // Import the CSS file

// Sample product data
const Anklets = [
  {
    id: 1,
    name: "Evil Eye Bracelet",
    price: 250,
    originalPrice: 500,
    image: evilEyeBracelet,
  },
  {
    id: 2,
    name: "Tropical Rainbow Anklet",
    price: 300,
    originalPrice: 600,
    image: TropicalRainbowAnklet,
  },
  {
    id: 3,
    name: "Evil Eye Broad Beads",
    price: 350,
    originalPrice: 700,
    image: boldbeads,
  },
  {
    id: 4,
    name: "Ocean Aura Anklets",
    price: 350,
    originalPrice: 700,
    image: OceanAuraAnklets,
  },
  {
    id: 5,
    name: "Multicolour with Small Pendant",
    price: 350,
    originalPrice: 700,
    image: multicolour,
  },
];

const Anklet = () => {
  const navigate = useNavigate();

  return (
    <div>
      <Header />
      <h1>Welcome to the ANKLETS category page!</h1>
      <div className="container">
        {Anklets.map((anklet) => (
          <div key={anklet.id} className="anklet-card">
            <div className="anklet-image-container">
              <img
                className="anklet-image"
                src={anklet.image}
                alt={anklet.name}
                onClick={() => navigate(`/anklets/${anklet.id}`)} // Navigate to Product Details
              />
            </div>
            <div className="anklet-name">{anklet.name}</div>
            <div className="anklet-price">
              <span className="new-price">${anklet.price}</span>{" "}
              <span className="old-price">${anklet.originalPrice}</span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Anklet;
